// SPDX-License-Identifier: UNLICENCED

pragma solidity >0.7.0 <0.9.0;

contract Time {

    uint public threeHours = 3 hours;
    uint public oneMinute = 1 minutes;
    uint public oneSecond = 1 seconds;

    uint public deployedDay;

    mapping(address => uint) donations;


    constructor() payable {
        deployedDay = block.timestamp;
    }


    function nowTime() view public returns(uint) {
        return block.timestamp;
    }

    function getSecondsTime(uint time) view public returns(uint) {
        return time * threeHours;
    }

    function daysPassedSinceLaunch() view public returns(bool) {
        uint date_1 = 1638352800; // 2012-12-01 10:00:00
        uint date_2 = block.timestamp + 1 days; // 2012-12-07 10:00:00
        return (date_1 > date_2);
    }

    function myBalance(address userAddress) public view returns(uint) {
        return address(userAddress).balance;
    }

    function contractBalance() public view returns(uint) {
        return address(this).balance;
    }

    function donate() payable external {
        require(msg.value >= 1 ether, "We only accept donations up to 1 ether");
        donations[msg.sender] += msg.value;
    }

    receive() external payable {}
}

